import React from "react";
import { Drawer, List, ListItemButton, ListItemIcon, ListItemText, Box, Divider, Typography } from "@mui/material";
import { Home, Calculate, School, EventNote, Code, Work } from "@mui/icons-material";
import { Link } from "react-router-dom";
import logo from "../assets/AptitudeArc.jpg";

const Sidebar = () => {
  return (
    <Drawer
      variant="permanent"
      sx={{
        width: 250,
        flexShrink: 0,
        "& .MuiDrawer-paper": { 
          width: 250, 
          boxSizing: "border-box", 
          backgroundColor: "#fff3e0", // Light orange background
          color: "#e65100", // Deep orange text
          borderRight: "3px solid #ff9800"
        },
      }}
    >
      {/* Logo Section */}
      <Box sx={{ display: "flex", flexDirection: "column", alignItems: "center", p: 2 }}>
        <img src={logo} alt="AptitudeArc Logo" style={{ width: "80%", maxWidth: "140px", borderRadius: "10px" }} />
        <Typography variant="h6" fontWeight="bold" sx={{ mt: 1, color: "#e65100" }}>
          AptitudeArc
        </Typography>
      </Box>

      <Divider sx={{ backgroundColor: "#ff9800", height: 2 }} />

      {/* Navigation List */}
      <List>
        <ListItemButton component={Link} to="/">
          <ListItemIcon sx={{ color: "#e65100" }}><Home /></ListItemIcon>
          <ListItemText primary="Home" />
        </ListItemButton>

        <ListItemButton component={Link} to="/general-aptitude">
          <ListItemIcon sx={{ color: "#e65100" }}><Calculate /></ListItemIcon>
          <ListItemText primary="General Aptitude" />
        </ListItemButton>

        <ListItemButton component={Link} to="/interview">
          <ListItemIcon sx={{ color: "#e65100" }}><EventNote /></ListItemIcon>
          <ListItemText primary="Interview" />
        </ListItemButton>

        <ListItemButton component={Link} to="/engineering">
          <ListItemIcon sx={{ color: "#e65100" }}><School /></ListItemIcon>
          <ListItemText primary="Engineering" />
        </ListItemButton>

        <ListItemButton component={Link} to="/programming">
          <ListItemIcon sx={{ color: "#e65100" }}><Code /></ListItemIcon>
          <ListItemText primary="Programming" />
        </ListItemButton>

        <ListItemButton component={Link} to="/placement">
          <ListItemIcon sx={{ color: "#e65100" }}><Work /></ListItemIcon>
          <ListItemText primary="Placement Papers" />
        </ListItemButton>
      </List>
    </Drawer>
  );
};

export default Sidebar;
